import React from 'react'

const Testimonials = () => {
    return (
        <div className='testimonials'>
            <div className='testimonials__content'>
                <h3>Testimonials</h3>
                <h6>Meet our Feline Clients</h6>
                <div className='testimonials__content__reviews'></div>
            </div>
        </div>
    )
}

export default Testimonials
